func TestMetadata_Decode(t *testing.T) {
	metadata := NewMetadata()

	err := DecodeFromBytes(encodedMetadata, metadata)
	assert.NoError(t, err)

	assert.Equal(t, decodedMetadata, fmt.Sprintf("%v", metadata))
}

